    private ArrayList<Province> provinces = new ArrayList<Province>();

    @Test
    public void algorithmTest() throws IOException {
        generateProvinceList();

        DijkstraAlgorithm d = new DijkstraAlgorithm(adjacencyMatrix, provinces);
    
        assert(d.findShortestPathLength("Britannia", "Lugdunensis") == 1);
        assert(d.findShortestPathLength("Britannia", "Belgica") == 2);
    }

    @Test
    public void multipleFactionsTest() throws IOException {
        generateProvinceList();
    
        DijkstraAlgorithm d = new DijkstraAlgorithm(adjacencyMatrix, provinces);
        
        assert(d.findShortestPathLength("Raetia", "Narbonensis") == 2);

        Player newPlayer = new Player(1, "Faction1");
        changePlayer("Alpes Graiae et Poeninae", newPlayer);
        changePlayer("Germania Superior", newPlayer);

        assert(d.findShortestPathLength("Raetia", "Narbonensis") == 3);
    } 

    private void generateProvinceList() throws IOException {        
        // Creating a player
        Player player1 = new Player(0, "Faction0");
        
        // Creating the province list
        JSONObject jo = new JSONObject(provincesList);
        JSONArray ja = jo.getJSONArray("provinces_list");
        
        for (int i = 0; i < ja.length(); i++) {
            provinces.add(new Province(ja.getString(i), player1, unitConfig));
        }
    }

    private void changePlayer(String provinceName, Player player) {
        // Finding the province
        for (Province p : provinces) {
            if (p.getName().equals(provinceName)) {
                p.setPlayer(player);
                break;
            }
        }
    }
